angular.module('app.directives')
    .directive('menuActivated',
    ['$location', function ($location) {
        return {
            restrict: 'A',
            link: function (scope,element,attr) {
                  /*
                    watch metodo ao qual fica assistindo a mudança de algum valor
                   */
                  scope.$watch(function (){
                      // a mudação do location, rota
                      return $location.path();
                      //quando tem uma nova mudança
                  }, function (newValue) {
                      //pegamos todos os li[data-match-route] definido
                      var liElements = element[0].querySelectorAll('li[data-match-route]');
                      //utilizar o angular para fazer um for each em todos os elemtens
                      angular.forEach(liElements, function (li) {
                          //pegamos o li com o angular element
                          var liElement = angular.element(li);
                          //adiciona o patter com expressão regular para verificar se existe alguma rota sobrando
                          var pattern = liElement.attr('data-match-route').replace('/','\\/');
                          var regexp = new RegExp(pattern,'i');
                          //realiza um teste do novo valor
                          //para verificar se a rota acessada bate com o data-match-route
                          if (regexp.test(newValue)){
                              //quando bate ele acrescenta a classe para ativar
                              liElement.children().first().addClass('actived');
                          } else {
                              //quando não bate ele remove a classe de ativação para ativar a proxima.
                              liElement.children().first().removeClass('actived');
                          }

                      });
                  });

            },
        };
    }]);
angular.module('app.directives')
    .directive('projectFileDownload',
    ['$timeout','$window','appConfig', 'ProjectFile',  function($timeout,$window,appConfig,ProjectFile){
        return {
            restrict: 'E',
            templateUrl: appConfig.baseUrl + '/build/views/templates/projectFileDownload.html',
            link: function(scope, element, attr){
                var anchor = element.children()[0];
                /*Evento*/
                scope.$on('salvar-arquivo',function(event,data){

                     $(anchor).removeClass('disabled');
                     $(anchor).text('Save File');
                     blobUtil.base64StringToBlob(data.file).then(function (blob) {
                        /*Indica que temos um dado binário no href e indica que está com o base64*/
                         $(anchor).attr({
                            href: $window.URL.createObjectURL(blob,data.mime_type),
                            download: data.name
                         });

                     });


                     /*TimeOut para dar um leg de segundo para não apresentar erro*/
                     $timeout(function(){

                        /* após executar a primeira vez, irá limpar o $scope.downloadFile para
                            não ficar num loop */
                        scope.downloadFile = function (){
                            $(anchor).text('Download');
                        };
                        /*irá pegar a ancora e chamar o metodo de click para clicar em download e já baixar o arquivo*/
                        $(anchor)[0].click();
                     });
                });
            },
            /*
            $element = Serviço que permite ter acesso na diretiva
            var anchor = $element.children()[0]; = pega o elemento da ancora, como
                                                   temos somente 1 elemento então colocamos 0, pois ele é
                                                   o elemento zero
            */
            controller: ['$scope','$element','$attrs',
                function($scope,$element,$attrs){
                    /*
                      desabilita o botão para o download do arquivo
                    */
                    $scope.downloadFile = function (){
                        var anchor = $element.children()[0];
                        $(anchor).addClass('disabled');
                        $(anchor).text('Loading...');

                        ProjectFile.download({id: $attrs.idProject, idFile: $attrs.idFile}, function(data){
                            $scope.$emit('salvar-arquivo',data);
                        });
                    }
            }]
        };
    }
]);
