//serviço para corrigir o Interceptor por causa do OAuth que utilizamos no projeto
//pois os erros de rejeição não está passando corretamente
angular.module('app.services')
    .service('oauthFixInterceptor',
        ['$q','$rootScope','OAuthToken', function ($q, $rootScope, OAuthToken) {
        return {
            request: function (config) {
                if (OAuthToken.getAuthorizationHeader()) {
                    config.headers = config.headers || {};
                    config.headers.Authorization = OAuthToken.getAuthorizationHeader();
                }
                return config;
            },
            responseError: function (rejection) {
                var deferred = $q.defer();
                if (400 === rejection.status && rejection.data
                    && ("invalid_request" === rejection.data.error || "invalid_grant" === rejection.data.error)) {
                    OAuthToken.removeToken();
                    $rootScope.$emit("oauth:error", {rejection: rejection, deferred: deferred});
                }
                if (401 === rejection.status
                    && rejection.data && "access_denied" === rejection.data.error || rejection.headers("www-authenticate")
                    && 0 === rejection.headers("www-authenticate").indexOf("Bearer")) {
                    $rootScope.$emit("oauth:error", {rejection: rejection, deferred: deferred});
                    return deferred.promise;
                }
                return $q.reject(rejection);
            }

        };
     }]);

angular.module('app.services')
    .service('Project',['$resource','$filter','$httpParamSerializer','appConfig',
        function($resource,$filter,$httpParamSerializer,appConfig){
        function transformData(data,headers){
            //verifica se o objeto � data e � o campo due_date
            if(angular.isObject(data) && data.hasOwnProperty('due_date')){
                var o = angular.copy(data);
                o.due_date = $filter('date')(data.due_date,'yyyy-MM-dd');
                return appConfig.utils.transformRequest(o);// $httpParamSerializer(o);
            }
            return data;
        };

        return $resource(appConfig.baseUrl + '/projects/:id',{id: '@id'},{
            save: {
                method: 'POST',
                transformRequest: transformData
            },
            get: {
              method: 'GET',
                transformResponse: function(data, headers){
                    var o = appConfig.utils.transformResponse(data,headers);
                    if(angular.isObject(o) && o.hasOwnProperty('due_date')){
                        var arrayDate = o.due_date.split('-')
                        month = parseInt(arrayDate[1])-1;
                        o.due_date = new Date(arrayDate[0],month,arrayDate[2]);
                    }
                    return o;
                }
            },
            query: {
                isArray: false
            },
            update: {
                method: 'PUT',
                transformRequest: transformData

            }
        });
    }
    ]);
